import React, { Component } from "react";
import "../Dashboard.css";

class Payment extends Component {
  // constructor(props){
  //     this.state={

  //     }
  // }

  render() {
    return (
      <div className="form-main1">
        <div className="online-payment">Online Payment</div>
        <div className="form-main2">
          <form>
            <label>
              <div className="payment-category">Payment Category</div>
              <div className="select-button">
                <select>
                  <option>Internal</option>
                  <option>External</option>
                  <option>Repeat</option>
                </select>
              </div>
              <div className="payment-amount">Payment Amount</div>
              <div className="number1">
                <input type="number" />
              </div>
              <div className="payment-description">Payment Description</div>
              <div className="text">
                <input type="text" />
              </div>
            </label>
          </form>
          <div className="select-category">Select your category to proceed*</div>
          <div className="submit-button">
            <div>
              <button>Submit</button>
            </div>
            <div>
              <button>Cancle</button>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Payment;
